window.bookSummaryJSON = "<p>Much like accountants, fey never forget a debt.</p> <p>Just as Fred is settling down in his new abode, he receives word that a favor is being called in, one he promised to a dangerously powerful member of otherworldly royalty. Bracing danger, adventure, and unknown threats, Fred is instead asked to take on an entirely different role than anticipated.</p> <p>Acting as interim professor at one of the few universities for supernatural entities, Fred will have to navigate a strange environment, eccentric coworkers, and unenthusiastic students. Yet that alone won't be enough, for this college has more history than the tales in its tomes.</p> <p>Remnants of the past that could put Fred, and his students, in mortal peril.</p>"; 
